import React, { useState, useEffect } from 'react';
import axios from 'axios';

import { useUser } from "@clerk/clerk-react";


function History() {
  const [history, setHistory] = useState([]);
  const { isSignedIn, user, isLoaded } = useUser();

  const userId = user.id;

  useEffect(() => {
    axios.get(`http://localhost:3001/api/history/${userId}`)
      .then(response => setHistory(response.data))
      .catch(error => console.error('Error fetching history:', error));
  }, [userId]);

  return (
    <div className='mt-[500px] text-white'>
      <h2>History</h2>
      <ul>
        {history.map(item => (
          <li key={item._id}>

            {/* Embedding video using Cloudinary URL */}
            Input Video : 
            <video width="640" height="360" controls>
                <source src={item.inputVideoUrl} type="video/mp4" />
                Your browser does not support the video tag.
            </video>
            Input Video : 
            <video width="640" height="360" controls>
                <source src={item.inputVideoUrl} type="video/mp4" />
                Your browser does not support the video tag.
            </video>
            {/* <div>Input Video: {item.inputVideoUrl}</div>
            <div>Output Video: {item.outputVideoUrl}</div> */}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default History;




